ks.x:
var $bm_rt;
var points = 20;
var width = 500;
var height = 10;
var speed = 1.57;
var offsetY = 110;
var verts = [];
for (var i = 0; i <= points; i++) {
    var x = $bm_mul($bm_div(i, points), width);
    var y = $bm_sum($bm_mul(Math.sin($bm_sum($bm_mul($bm_mul($bm_div(i, points), Math.PI), 2), $bm_mul(time, speed))), height), offsetY);
    verts.push([
        x,
        y
    ]);
}
verts.push([
    width,
    400
]);
verts.push([
    0,
    200
]);
$bm_rt = createPath(verts, [], [], true);

